/*Table structure for table `user_previlege` */

DROP TABLE IF EXISTS `user_previlege`;

CREATE TABLE `user_previlege` (
  `id_user` int(11) NOT NULL AUTO_INCREMENT,
  `tipe_user` enum('free','paid') DEFAULT NULL,
  `expiry_date` date DEFAULT NULL,
  PRIMARY KEY (`id_user`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4;

